(1,	NULL,	'var current = new Date;\r\n    current = current.getFullYear() + \'-\' + ((current.getMonth() + 1) < 10 ? \'0\' + (current.getMonth() + 1).toString() : (current.getMonth() + 1)) + \'-01\';\r\n\r\n    orm.query(\r\n        \'SELECT \' +\r\n        \'COUNT(*) as `total_number_of_employees` \' +\r\n        \'FROM \' +\r\n        \'`trendata_bigdata_user` AS `tbu` \' +\r\n        \'INNER JOIN \' +\r\n        \'`trendata_bigdata_user_position` AS `tbup` \' +\r\n        \'ON \' +\r\n        \'`tbu`.`trendata_bigdata_user_id` = `tbup`.`trendata_bigdata_user_id` \' +\r\n        \'WHERE \' +\r\n        \'((`tbup`.`trendata_bigdata_user_position_termination_date` IS NOT NULL AND `tbup`.`trendata_bigdata_user_position_hire_date` <= ? AND `tbup`.`trendata_bigdata_user_position_termination_date` >= ?) \' +\r\n        \'OR \' +\r\n        \'(`tbup`.`trendata_bigdata_user_position_termination_date` IS NULL AND `tbup`.`trendata_bigdata_user_position_hire_date` <= ?)) \' +\r\n        \'AND \' +\r\n        \'`tbu`.`trendata_user_id`=?\'\r\n    , {\r\n            type: ORM.QueryTypes.SELECT,\r\n            replacements: [\r\n                current,\r\n                current,\r\n                current,\r\n                req && req.user && req.user.trendata_user_id || 0\r\n            ]\r\n    }).then(function (rows) {\r\n        _resolve({\r\n            data: [\r\n                {\r\n                    labes: \'\',\r\n                    value: rows[0][\'total_number_of_employees\']\r\n                }\r\n            ]\r\n        });\r\n    }).catch(_reject);',	'2017-03-10 15:38:53',	'2017-03-10 10:58:30',	61),
