(3,	NULL,	'Promise.props({\r\n        /**\r\n         *\r\n         */\r\n        users: commonChartData.getUsersList(req),\r\n\r\n        /**\r\n         *\r\n         */\r\n        chartData: (function () {\r\n            /**\r\n             * @return {Array<String>}\r\n             */\r\n            function rangeDate() {\r\n                var current = new Date;\r\n                var date1 = new Date(current.getFullYear(), current.getMonth(), 1, 23);\r\n                var date2 = new Date(current.getFullYear() - 1, current.getMonth(), 1, 23);\r\n                var between = [];\r\n                var month;\r\n\r\n                while(date2 < date1) {\r\n                    month = date1.getMonth() + 1;\r\n                    if (month < 10) {\r\n                        month = \'0\' + month.toString();\r\n                    }\r\n                    between.push(date1.getFullYear() + \'-\' + month);\r\n                    date1 = new Date(date1.setMonth(date1.getMonth() - 1));\r\n                }\r\n\r\n                return between.reverse();\r\n            }\r\n\r\n            return Promise.map(rangeDate(), function (item) {\r\n                return orm.query(\r\n                    \'SELECT COUNT(*) AS `count` FROM `trendata_bigdata_user` AS `tbu` \' +\r\n                    \'INNER JOIN `trendata_bigdata_user_position` AS `tbup` ON `tbu`.`trendata_bigdata_user_id` = `tbup`.`trendata_bigdata_user_id` \' +\r\n                    \'WHERE \' +\r\n                    \'((`tbup`.`trendata_bigdata_user_position_termination_date` IS NOT NULL AND `tbup`.`trendata_bigdata_user_position_hire_date` <= ? AND `tbup`.`trendata_bigdata_user_position_termination_date` >= ?) \' +\r\n                    \'OR \' +\r\n                    \'(`tbup`.`trendata_bigdata_user_position_termination_date` IS NULL AND `tbup`.`trendata_bigdata_user_position_hire_date` <= ?)) \' +\r\n                    \'AND \' +\r\n                    \'`tbu`.`trendata_user_id`=?\'\r\n          