(4,	NULL,	'function number_format(number, decimals, dec_point, thousands_sep) {\r\n        number = (number + \'\').replace(/[^0-9+\\-Ee.]/g, \'\');\r\n        var n = !isFinite(+number) ? 0 : +number,\r\n            prec = !isFinite(+decimals) ? 0 : Math.abs(decimals),\r\n            sep = (typeof thousands_sep === \'undefined\') ? \',\' : thousands_sep,\r\n            dec = (typeof dec_point === \'undefined\') ? \'.\' : dec_point,\r\n            s = \'\',\r\n            toFixedFix = function (n, prec) {\r\n                var k = Math.pow(10, prec);\r\n                return \'\' + Math.round(n * k) / k;\r\n            };\r\n        // Fix for IE parseFloat(0.55).toFixed(0) = 0;\r\n        s = (prec ? toFixedFix(n, prec) : \'\' + Math.round(n)).split(\'.\');\r\n        if (s[0].length > 3) {\r\n            s[0] = s[0].replace(/\\B(?=(?:\\d{3})+(?!\\d))/g, sep);\r\n        }\r\n        if ((s[1] || \'\').length < prec) {\r\n            s[1] = s[1] || \'\';\r\n            s[1] += new Array(prec - s[1].length + 1).join(\'0\');\r\n        }\r\n        return s.join(dec);\r\n    }\r\n\r\n    var current = new Date;\r\n    current = current.getFullYear() + \'-\' + ((current.getMonth() + 1) < 10 ? \'0\' + (current.getMonth() + 1).toString() : (current.getMonth() + 1)) + \'-01\';\r\n\r\n    orm.query(\r\n        \'SELECT \' +\r\n        \'ROUND(AVG(`tbu`.`trendata_bigdata_user_salary`), 0) as `average_salary` \' +\r\n        \'FROM `trendata_bigdata_user` AS `tbu` \' +\r\n        \'INNER JOIN \' +\r\n        \'`trendata_bigdata_user_position` AS `tbup` \' +\r\n        \'ON \' +\r\n        \'`tbu`.`trendata_bigdata_user_id` = `tbup`.`trendata_bigdata_user_id` \' +\r\n        \'WHERE \' +\r\n        \'((`tbup`.`trendata_bigdata_user_position_termination_date` IS NOT NULL AND `tbup`.`trendata_bigdata_user_position_hire_date` <= ? AND `tbup`.`trendata_bigdata_user_position_termination_date` >= ?) \' +\r\n        \'OR \' +\r\n        \'(`tbup`.`trendata_bigdata_user_position_termination_date` IS NULL AND `tbup`.`trendata_bigdata_user_position_hire_date` <= ?)) AND `tbu`.`trendata_user_id`=?\'\r\n        , {\r\n            type: ORM.QueryTypes.SELECT,\r\n            replacements: [\r\n                current,\r\n                current,\r\n                current,\r\n                req && req.user && req.user.trendata_user_id || 0\r\n            ]\r\n        }\r\n    ).then(function (rows) {\r\n        _resolve({\r\n            data: [\r\n                {\r\n                    label: \'\',\r\n                    value: rows[0].average_salary ? (\'$\' + number_format(rows[0].average_salary)) : \'No data\'\r\n                }\r\n            ]\r\n        });\r\n    }).catch(_reject);',	'2017-03-22 12:42:58',	'2017-03-22 12:42:58',	60),
